import React from 'react';
import Svg, { Path, Circle, Ellipse } from 'react-native-svg';
const Image = () => {
    return (
        <Svg
            width={50}
            height={50}
            viewBox="0 0 595.3 841.9"

        >
            <circle
                cx={167}
                cy={171}
                r={85}
                style={{
                    fill: '#fff',
                    stroke: '#000',
                    strokeMiterlimit: 10,
                }}
            />
            <Ellipse
                cx={267}
                cy={217}
                rx={92}
                ry={61}
                style={{
                    fill: '#ed2024',
                    stroke: '#000',
                    strokeMiterlimit: 10,
                }}
            />
        </Svg>
    );
};

export default Image;
